import React from "react";

function Survey() {
  function handleClick(e) {
    e.preventDefault();
    console.log("The link was clicked.");
  }

  return (
    <div>
      <h2 onClick={handleClick}>Boom</h2>!
    </div>
  );
}

export default Survey;
